  [],\n\t\"revision_timestamp\": \"2015-05-06T22:38:30.567367\",\n\t\"name\": \"practical-multi-disciplinary-analysis-tools-for-combustion-devices-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The use of multidisciplinary analysis (MDA)
  techniques for combustion device environment prediction, including complex fluid
  mixing phenomena, is now becoming possible as numerical algorithms and high performance
  computing clusters become more powerful.  Parallel solution methodologies and distributed
  memory architectures are currently available, yet the challenge of bringing highly
  sophisticated MDA research algorithms into a fast-paced NASA engineering environment
  still remains.  In particular, continued improvements in current analysis tools
  and further validation of physical models are still needed to develop practical
  MDA capabilities.  The product of our proposed Phase II effort will be an to compute
  turbulent, chemically reacting flows with coupled structural heating.  Our unique
  approach, employing solution-based mesh refinement algorithms for generalized unstructured
  meshes, will provide NASA with the critical capability to solve fluid/structure
  interaction problems in a collaborative engineering environment.  The developed
  software will be capable of generating both performance and multi-dimensional environments
  for rocket engine combustion devices.  More specifically, it will support accurate
  and timely design analyses for all Exploration Vision propulsion systems combustion
  devices and will offer NASA a significantly improved, commercially viable analysis
  tool.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
